  setLowBallPoints(pplowpoints);
  setLowAngle(low_theta);
  //high ball
  const [high_theta, pphighpoints] = high_ball(target_x, target_y, vel, g, {x:null, y:0});
  setHighBallPoints(pphighpoints);
